  false,\n\t\"url\": null,\n\t\"notes\": \"This report was prepared by the Department
  of Water Resources (DWR), Northern Region Office (NRO), in coordination with the
  U.S. Fish and Wildlife Service (USFWS), Region 8 Refuges Inventory and Monitoring
  Program, as described in USFWS contract number F14PX91348. The contract includes
  tasks to be completed by NRO on a quarterly basis. The main tasks entail water quality
  sampling and flow measurements within the South Fork Pit River near the Modoc National
  Wildlife Refuge (MNWR) in the California portion of the Pacific Southwest Region.
  The purpose of this work is to determine whether sufficient quantities of good quality
  water are available for fish, wildlife, and plants now and into the future.\",\n\t\"license_title\":
